// src/pages/AAMS.jsx
import React from "react";

const AAMS = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold text-blue-600">Welcome to AAMS Home</h1>
      <p>This is the homepage content without login/logout.</p>
    </div>
  );
};

export default AAMS;
